/** 生成提示文案 */
export function createHeadHelpStr() {
  return "\n  /* eslint-disable */\n  /* tslint:disable */\n  // @ts-nocheck\n  \n  /**\n   * \u672C\u6587\u4EF6\u7531 mgop-generator \u81EA\u52A8\u751F\u6210\uFF0C \u5EFA\u8BAE\u8BF7\u52FF\u4FEE\u6539\n   */\n  ";
}
/**
 * 生成系统提示文案
 */

export function createModuleHeadHelpStr(system) {
  var sysName = system.sysName;
  return "\n  /* \u7CFB\u7EDF\u540D\u79F0: " + sysName + " */\n  /* eslint-disable */\n  /* tslint:disable */\n  // @ts-nocheck\n  \n  /**\n   * \u672C\u6587\u4EF6\u7531 mgop-generator \u81EA\u52A8\u751F\u6210\n   */\n  ";
}
/**
 * 生成接口提示文案
 */

export function creatInterfaceHelpStr(itf) {
  var description = itf.description,
      apiName = itf.apiName,
      apiNameCh = itf.apiNameCh;
  return "\n    /**\n     * \u63A5\u53E3\u540D\u79F0\uFF1A" + apiName + "\n     * \u63A5\u53E3\u4E2D\u6587\u540D\uFF1A" + apiNameCh + "\n     * \u63A5\u53E3\u63CF\u8FF0\uFF1A" + description + "\n     * @param req \u8BF7\u6C42\u53C2\u6570\n     */";
}